import React from "react";

function Header() {
  return (
    <div>
      <h1>COD Warzone Stats</h1>
      <form>
        <input id="gamertag" placeholder="gamertag" type="text" />
        <input id="platform" placeholder="platform" type="text" />
        <input type="submit" />
      </form>
    </div>
  );
}

export default Header;
